```css
.feature-card {
  transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
  cursor: pointer;
}

.feature-card:hover {
  transform: translateY(-4px);
  box-shadow: 0 12px 24px rgba(0, 0, 0, 0.08);
}

/*  */
.feature-card:hover .icon {
  transform: scale(1.1) rotate(5deg);
  transition: transform 0.3s ease;
}
```

